import React from "react";
import Logo from "../assets/images/logo.svg";

const Footer = () => {
  return (
    <footer>
      <section id="first">
        <div className="custom-container">
          <div className="logo">
            <img src={Logo} alt="" />
          </div>
          <div className="location">
            <h3>Ünvanlarımız</h3>
            <ul>
              <li></li>
              <li></li>
              <li></li>
            </ul>
          </div>
        </div>
      </section>
      <section id="second"></section>
    </footer>
  );
};

export default Footer;
